style.css:
/* General Background and Font */
body {
    background-color: #f0f0f0; /* Light gray background typical of older web designs */
    font-family: Arial, sans-serif; /* Simple sans-serif font */
}

/* Header */
header {
    background-color: #000; /* Black background for header */
    color: #fff; /* White text for header */
    padding: 10px 20px; /* Padding around the header */
    text-align: center; /* Centered text */
    font-size: 18px; /* Font size for the header text */
}

/* Navigation Menu */
nav {
    background-color: #333; /* Dark gray background for navigation */
    color: #fff; /* White text for navigation */
    padding: 10px; /* Padding around the navigation */
}

nav a {
    color: #fff; /* White text for links */
    text-decoration: none; /* No underline on links */
    margin: 0 10px; /* Spacing between links */
}

nav a:hover {
    text-decoration: underline; /* Underline on hover for links */
}

/* Main Content */
main {
    padding: 20px; /* Padding around main content */
    background-color: #fff; /* White background for content */
    border: 1px solid #ddd; /* Light gray border around content */
    box-shadow: 0 0 10px rgba(0, 0, 0, 0.1); /* Subtle shadow for a 2016 effect */
}

/* Buttons */
button {
    background-color: #007bff; /* Blue background for buttons */
    color: #fff; /* White text for buttons */
    border: none; /* No border */
    padding: 10px 20px; /* Padding inside buttons */
    font-size: 16px; /* Font size for button text */
    cursor: pointer; /* Pointer cursor on hover */
    border-radius: 5px; /* Rounded corners */
    transition: background-color 0.3s; /* Smooth background color transition */
}

button:hover {
    background-color: #0056b3; /* Darker blue on hover */
}

/* Footer */
footer {
    background-color: #000; /* Black background for footer */
    color: #fff; /* White text for footer */
    text-align: center; /* Centered text */
    padding: 10px 20px; /* Padding around footer */
    font-size: 14px; /* Font size for footer text */
    position: fixed; /* Fixed position at the bottom */
    width: 100%; /* Full width */
    bottom: 0; /* Align to bottom */
}
